import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Inicial from './pages/Inicial';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/'>
          <Route index element={<Inicial />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
